import ListItem from "../ListItem/ListItem";
import './List.css'

const CardList = ( {data} ) => {

    return ( 
        <div className="list">
            {data && data.map(item => <ListItem itemURL ={item.url} key={item.url}/>)}
        </div>
    );
}

export default CardList;
